data.value:
[LAYOUT]
-- General layout
<T>TICKET
<L00>Data:{TICKET DATE}
<L00>Ora:{TIME}
{ENTITIES}
<L00>Ticket #:{TICKET NO}
<F>-
{ORDERS}
<F>=
<EB>
{DISCOUNTS}
<J10>Totale Omaggio:|{ORDER STATE TOTAL:Gift}
<J10>Totale:|{TICKET TOTAL}
{PAYMENTS}
<DB>
<F>=
<C10>GRAZIE!!!

[DISCOUNTS]
<J00>{CALCULATION NAME} %{CALCULATION AMOUNT}|{CALCULATION TOTAL}

[PAYMENTS]
<J00>{PAYMENT NAME}|{PAYMENT AMOUNT}

[ORDERS]
-- Default format for orders
<J00>- {QUANTITY} {NAME}|{PRICE}
{ORDER TAGS}

[ORDERS:Gift]
-- Format for gifted orders
<J00>- {QUANTITY} {NAME}|**OMAGGIO**
{ORDER TAGS}

[ORDERS:Void]
-- Nothing will print for void lines

[ORDER TAGS]
-- Format for order tags
<J00> * {ORDER TAG NAME} | {ORDER TAG PRICE}

[ENTITIES:Table]
-- Table entity format
<L00>Table: {ENTITY NAME}

[ENTITIES:Customer]
-- Customer entity format
<J00>Customer: {ENTITY NAME} | {ENTITY DATA:Phone}

[LAYOUT]
<T>TICKET
<L00>Data:{TICKET DATE}
<L00>Ora:{TIME}
<L00>Locazione:{LOCATION}
<L00>Ticket N°:{TICKET NO}
<F>-
{ORDERS}

[ORDERS]
<J00>- {QUANTITY} {NAME}|{PRICE}
{ORDER TAGS}

[ORDERS:GIFT]
<J00>- {QUANTITY} {NAME}|{PRICE}
{ORDER TAGS}

[ORDERS:VOID]
<J00>- {QUANTITY} {NAME}|{PRICE}
{ORDER TAGS}

[ORDER TAGS]
-- Format for order tags
<L00>     * {ORDER TAG NAME}
